    [],nt"num_tags": 0,nt"name": "2006-federal-emergency-management-agency-fema-topographic-lidar-connecticut-coastline-survey",nt"isopen":
    false,nt"url": null,nt"notes": "LIDAR data is remotely sensed high-resolution
    elevation data collected by an airborne collection platform. By positioning laser
    range finding with the use of 1 second GPS with 100hz inertial measurement unit
    corrections; Terrapoint's LIDAR instruments are able to make highly detailed geospatial
    elevation products of the ground, man-made structures and vegetation. The LiDAR
    flightlines for this project was planned for a 50% acquisition overlap. The nominal
    resolution of this project without overlap is 1.25m. Four returns were recorded
    for each pulse in addition to an intensity value. GPS Week Time, Intensity, Flightline
    and number attributes were provided for each LiDAR point. Data is provided as random
    points, in LAS v1.0 format, classified according to ASPRS Class Code 2=Ground 1=Undefined.
    Water is included in the bare earth ground model, except where the entire tile is
    covered by water. The following regions of Connecticut are included in this project:
    Fairfield County - 130 square kilometers New Haven - 170 square kilometers Middlesex
    - 29 square kilometers New London - 157 square kilometers Please note that the LiDAR
    intensity is not calibrated or normalized. The intensity value is meant to provide
    relative signal return strengths for features imaged by the sensor.",nt"owner_org":
